import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
// @material-ui/icons

// core components
import Header from "components/Header/Header.jsx";
import Footer from "components/Footer/Footer.jsx";
import Button from "components/CustomButtons/Button.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import HeaderLinks from "components/Header/HeaderLinks.jsx";
import NavPills from "components/NavPills/NavPills.jsx";
import Parallax from "components/Parallax/Parallax.jsx";

//modal
import DialogTitle from "@material-ui/core/DialogTitle";
import DialogContent from "@material-ui/core/DialogContent";
import DialogActions from "@material-ui/core/DialogActions";
import LibraryBooks from "@material-ui/icons/LibraryBooks";
import Close from "@material-ui/icons/Close";
import Dialog from "@material-ui/core/Dialog";
import IconButton from "@material-ui/core/IconButton";
import Slide from "@material-ui/core/Slide";

//Images and icons
import profile from "assets/img/faces/tyre.png";
import tyreFront from 'assets/img/faces/tyreFront.jpg'
import tyreRear from 'assets/img/faces/tyreRear.jpg'
import tyreSide from '../assets/img/faces/tyreSide.png';

import TableStats from '../builtComponents/SmallComponents/TableStats'

import profilePageStyle from "assets/jss/material-kit-react/views/profilePage.jsx";

function Transition(props) {
  return <Slide direction="down" {...props} />;
}


class LandingPage extends React.Component {
  render() {
    const { classes, ...rest } = this.props;
    const imageClasses = classNames(
      classes.imgRaised,
      classes.imgRoundedCircle,
      classes.imgFluid
    );
    const navImageClasses = classNames(classes.imgRounded, classes.imgGallery);
    return (
      <div>
        <Header
          color="transparent"
          brand="TyreInspect"
          rightLinks={<HeaderLinks />}
          fixed
          changeColorOnScroll={{
            height: 200,
            color: "white"
          }}
          {...rest}
        />
        <Parallax small filter image={require("assets/img/profile-bg.jpg")} />
        <div className={classNames(classes.main, classes.mainRaised)}>
          <div>
            <div className={classes.container}>
              <GridContainer >
                <GridItem xs={4} sm={4} md={4}>
                  <div className={classes.profile}>
                    <div>
                      <img src={profile} alt="..." className={imageClasses} />
                    </div>
                    <div className={classes.name}>
                      {/* <h3 className={classes.title}>Christian Louboutin</h3>
                      <h6>DESIGNER</h6> */}
                      {/* <Button justIcon link className={classes.margin5}>
                        <i className={"fab fa-twitter"} />
                      </Button>
                      <Button justIcon link className={classes.margin5}>
                        <i className={"fab fa-instagram"} />
                      </Button>
                      <Button justIcon link className={classes.margin5}>
                        <i className={"fab fa-facebook"} />
                      </Button> */}
                    </div>
                  </div>
                </GridItem>
              </GridContainer>
              {/* <div className={classes.description}>
                <p>
                  An artist of considerable range, Chet Faker — the name taken
                  by Melbourne-raised, Brooklyn-based Nick Murphy — writes,
                  performs and records all of his own music, giving it a warm,
                  intimate feel with a solid groove structure.{" "}
                </p>
              </div> */}
              <GridContainer >
                <GridItem xs={12} sm={6} md={6} lg={6}>
                  <NavPills
                    // alignCenter
                    color="warning"
                    tabs={[
                      {
                        tabButton: "Front View",

                        tabContent: (
                          <GridContainer >
                            <GridItem xs={12} sm={12} md={8}>
                              <img
                                alt="..."
                                src={tyreFront}
                                className={navImageClasses}
                              />

                            </GridItem>
                          </GridContainer>
                        )
                      },
                      {
                        tabButton: "Rear View",
                        // tabIcon: Palette,
                        tabContent: (
                          <GridContainer >
                            <GridItem xs={12} sm={12} md={8}>
                              <img
                                alt="..."
                                src={tyreRear}
                                className={navImageClasses}
                              />

                            </GridItem>
                          </GridContainer>
                        )
                      },
                      {
                        tabButton: "Side View",
                        // tabIcon: Favorite,
                        tabContent: (
                          <GridContainer >
                            <GridItem xs={12} sm={12} md={8}>
                              <img
                                alt="..."
                                src={tyreSide}
                                className={navImageClasses}
                              />
                            </GridItem>
                          </GridContainer>
                        )
                      }
                    ]}
                  />
                </GridItem>
                {/* Table stats */}

                <GridItem xs={12} sm={6} md={6} lg={6}>
                  <h2 className={classes.title} style={{ textAlign: "center" }}>Inspection Statistics</h2>
                  <TableStats {...this.props} />

                </GridItem>

                <GridContainer>
                <GridItem xs={12} sm={12} md={12} lg={12}>
                  <Button
                    color="primary"
                    block
                    onClick={() => this.handleClickOpen("classicModal")}
                  >
                    <LibraryBooks className={classes.icon} />
                    Classic
                  </Button>
                  <Dialog
                    classes={{
                      root: classes.center,
                      paper: classes.modal
                    }}
                    open={this.state.classicModal}
                    TransitionComponent={Transition}
                    keepMounted
                    onClose={() => this.handleClose("classicModal")}
                    aria-labelledby="classic-modal-slide-title"
                    aria-describedby="classic-modal-slide-description"
                  >
                    <DialogTitle
                      id="classic-modal-slide-title"
                      disableTypography
                      className={classes.modalHeader}
                    >
                      <IconButton
                        className={classes.modalCloseButton}
                        key="close"
                        aria-label="Close"
                        color="inherit"
                        onClick={() => this.handleClose("classicModal")}
                      >
                        <Close className={classes.modalClose} />
                      </IconButton>
                      <h4 className={classes.modalTitle}>Modal title</h4>
                    </DialogTitle>
                    <DialogContent
                      id="classic-modal-slide-description"
                      className={classes.modalBody}
                    >
                      <p>
                        Far far away, behind the word mountains, far from the
                        countries Vokalia and Consonantia, there live the blind
                        texts. Separated they live in Bookmarksgrove right at
                        the coast of the Semantics, a large language ocean. A
                        small river named Duden flows by their place and
                        supplies it with the necessary regelialia. It is a
                        paradisematic country, in which roasted parts of
                        sentences fly into your mouth. Even the all-powerful
                        Pointing has no control about the blind texts it is an
                        almost unorthographic life One day however a small line
                        of blind text by the name of Lorem Ipsum decided to
                        leave for the far World of Grammar.
                      </p>
                    </DialogContent>
                    <DialogActions className={classes.modalFooter}>
                      <Button color="transparent" simple>
                        Nice Button
                      </Button>
                      <Button
                        onClick={() => this.handleClose("classicModal")}
                        color="danger"
                        simple
                      >
                        Close
                      </Button>
                    </DialogActions>
                  </Dialog>
                </GridItem>
              </GridContainer>
              </GridContainer>

            </div>
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}

export default withStyles(profilePageStyle)(LandingPage);
